CREATE TABLE `e_categories` (
  `cat_id` int(10) NOT NULL AUTO_INCREMENT,
  `public_id` varchar(40) NOT NULL,
  `title` varchar(255) NOT NULL,
  `cat_ref_slug` varchar(128) DEFAULT NULL,
  `cat_desc` varchar(255) NOT NULL,
  `cat_meta_description` text,
  `cat_meta_keyword` text,
  `cat_slug` varchar(255) NOT NULL,
  `parent` int(11) NOT NULL,
  `cat_img` varchar(255) NOT NULL DEFAULT 'noimage.jpg',
  `cat_thumb` varchar(255) NOT NULL DEFAULT 'noimage.jpg',
  `cat_order` int(3) NOT NULL,
  `no_of_ads` int(11) NOT NULL DEFAULT '0',
  `buy` enum('0','1') NOT NULL,
  `sell` enum('0','1') NOT NULL,
  `rent` enum('0','1') NOT NULL,
  `max_price` varchar(20) NOT NULL,
  `ad_type_id_fk` int(11) NOT NULL,
  `is_active` enum('0','1') NOT NULL DEFAULT '1' COMMENT '1- Active / 0 - Inactive',
  `is_popular` enum('0','1') NOT NULL DEFAULT '0' COMMENT '1- Popular / 0 - Not Popular',
  `deleted_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00',
  `created_at` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `is_explore_directory` enum('1','0') NOT NULL DEFAULT '0',
  `is_allow_to_add_deal` enum('1','0') NOT NULL DEFAULT '0',
  PRIMARY KEY (`cat_id`),
  KEY `parent` (`parent`),
  KEY `parent_2` (`parent`)
) ENGINE=InnoDB AUTO_INCREMENT=202 DEFAULT CHARSET=latin1 COMMENT='Soft Delete AND Active/Block Maintained';
