CREATE TABLE `e_categories_brand` (
  `brand_id` int(11) NOT NULL AUTO_INCREMENT,
  `fk_cat_id` int(11) NOT NULL,
  `brand_name` varchar(200) NOT NULL,
  `is_active` enum('0','1') NOT NULL DEFAULT '1' COMMENT '0-blocked 1-active',
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00',
  PRIMARY KEY (`brand_id`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1 COMMENT='No Soft Delete OR Active/Block To be Maintained';
CREATE TABLE `e_cities` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
