CREATE TABLE `e_deals` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `business_id` int(11) NOT NULL COMMENT 'fk_business_id',
  `public_id` varchar(255) NOT NULL,
  `name` varchar(150) NOT NULL,
  `price` float(15,2) NOT NULL,
  `discount_price` double NOT NULL,
  `description` varchar(500) NOT NULL,
  `deal_image` varchar(150) NOT NULL,
  `deal_type` enum('1','2','3') NOT NULL COMMENT '1-normal deal, 2-instant deal, 3-featured deal',
  `avg_rating` tinyint(1) NOT NULL,
  `redeem_count` tinyint(1) NOT NULL,
  `start_day` datetime NOT NULL,
  `end_day` datetime NOT NULL,
  `start_time` varchar(10) NOT NULL,
  `end_time` varchar(10) NOT NULL,
  `is_active` enum('0','1') NOT NULL DEFAULT '1',
  `created_at` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  `updated_at` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00',
  `deleted_at` timestamp NULL DEFAULT NULL,
  `parent_category_id` int(11) NOT NULL COMMENT 'Fk =>parent_category_id,Pk=>Category ID',
  `things_to_remember` text NOT NULL,
  `about` text NOT NULL,
  `facilities` text NOT NULL,
  `cancellation_policy` text NOT NULL,
  `title` varchar(255) NOT NULL,
  `how_to_use` text NOT NULL,
  `json_location_point` mediumtext NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=54 DEFAULT CHARSET=latin1;
