	,(28, 61, '', 'EsselWorld & Water Kingdom, Borivali West', 5001.00, 501, '<p><span style=\"font-family: \'Open Sans\', sans-serif; font-size: 14px; line-height: 20px;\">EsselWorld is an excitement and entertainment packed park that offers fun for everyone! The park features heart racing rides, a bowling alley, 3400 sq. ft. ice skating rink, dance floor and more. Head there with the whole family and you\'ll find fun things to do for all!&nbsp;The park has a choice of eating options including Southern Treat, Domino&rsquo;s, Taipan, Ohh! Mumbai and More! Water Kingdom is Indi', '9ab4b5d4c0788c0ed81df73971afef3df9bd333f.jpg', 1, 0, 0, '2016-05-06 00:00:00', '2016-06-06 00:00:00', '', '', 0, '2016-05-13 05:03:54', '2016-05-12 23:31:43', '2016-05-12 23:31:43', 0, '<ul>\r\n<li style=\"box-sizing: border-box; outline: 0px; margin: 0px; padding: 0px; font-size: 14px; color: #585858; line-height: 1.8; font-family: \'Open Sans\', sans-serif;\">Timings:</li>\r\n<li style=\"box-sizing: border-box; outline: 0px; margin: 0px; padding: 0px; font-size: 14px; color: #585858; line-height: 1.8; font-family: \'Open Sans\', sans-serif;\">Weekdays - 10:00AM to 8:00PM</li>\r\n<li style=\"box-sizing: border-box; outline: 0px; margin: 0px; padding: 0px; font-size: 14px; color: #585858; line-height: 1.8; font-family: \'Open Sans\', sans-serif;\">Weekends - 9:30AM to 9:00PM</li>\r\n<li style=\"box-sizing: border-box; outline: 0px; margin: 0px; padding: 0px; font-size: 14px; color: #585858; line-height: 1.8; font-family: \'Open Sans\', sans-serif;\">Child would be considered if height between 3ft 3 In &amp; 4ft 6 In</li>\r\n<li style=\"box-sizing: border-box; outline: 0px; margin: 0px; padding: 0px; font-size: 14px; color: #585858; line-height: 1.8; font-family: \'Open Sans\', sans-serif;\">Adult would be considered if height above 4ft 6 In</li>\r\n<li style=\"box-sizing: border-box; outline: 0px; margin: 0px; padding: 0px; font-size: 14px; color: #585858; line-height: 1.8; font-family: \'Open Sans\', sans-serif;\">Valid for adult &amp; children tickets only - Not applicable for Sr. Citizens</li>\r\n<li style=\"box-sizing: border-box; outline: 0px; margin: 0px; padding: 0px; font-size: 14px; color: #585858; line-height: 1.8; font-family: \'Open Sans\', sans-serif;\">Nylon / Lycra Swimwear is mandatory for Water Kingdom</li>\r\n<li style=\"box-sizing: border-box; outline: 0px; margin: 0px; padding: 0px; font-size: 14px; color: #585858; line-height: 1.8; font-family: \'Open Sans\', sans-serif;\">Ferry Ticket Price: Rs.50</li>\r\n<li style=\"box-sizing: border-box; outline: 0px; margin: 0px; padding: 0px; font-size: 14px; color: #585858; line-height: 1.8; font-family: \'Open Sans\', sans-serif;\">F&amp;B, Lockers &amp; Other Services - Charges extra</li>\r\n<li style=\"box-sizing: border-box; outline: 0px; margin: 0px; padding: 0px; font-size: 14px; color: #585858; line-height: 1.8; font-family: \'Open Sans\', sans-serif;\">Prior reservation of 3hrs recommended before visiting the park (Upon purchase, you will receive a voucher with the reservation number)</li>\r\n<li style=\"box-sizing: border-box; outline: 0px; margin: 0px; padding: 0px; font-size: 14px; color: #585858; line-height: 1.8; font-family: \'Open Sans\', sans-serif;\">Carrying voucher printout is mandatory with a photo id &amp; photo copy of the same to avail the offer (Photo copy services are also available at the park for Rs.5)</li>\r\n<li style=\"box-sizing: border-box; outline: 0px; margin: 0px; padding: 0px; font-size: 14px; color: #585858; line-height: 1.8; font-family: \'Open Sans\', sans-serif;\">Please redeem the coupon only when you are at EsselWorld &amp; Water Kingdom - Let the merchant redeem the voucher at the ticket counter</li>\r\n<li style=\"box-sizing: border-box; outline: 0px; margin: 0px; padding: 0px; font-size: 14px; color: #585858; line-height: 1.8; font-family: \'Open Sans\', sans-serif;\">Tickets are non-cancellable</li>\r\n<li style=\"box-sizing: border-box; outline: 0px; margin: 0px; padding: 0px; font-size: 14px; color: #585858; line-height: 1.8; font-family: \'Open Sans\', sans-serif;\">All offers are inclusive of taxes &amp; service charges</li>\r\n</ul>', '<p><span style=\"font-family: \'Open Sans\', sans-serif; font-size: 14px; line-height: 20px;\">EsselWorld is an excitement and entertainment packed park that offers fun for everyone! The park features heart racing rides, a bowling alley, 3400 sq. ft. ice skating rink, dance floor and more. Head there with the whole family and you\'ll find fun things to do for all!&nbsp;The park has a choice of eating options including Southern Treat, Domino&rsquo;s, Taipan, Ohh! Mumbai and More! Water Kingdom is India&rsquo;s largest Aqua pool offering a splash of fun to all ages. The 22 acres water kingdom features is the ideal family play port and features 3 kiddie slides, 4 family slides, 3 adult-thrill slides. Also have some fun with the water umbrellas, spinning water tray and waterfall.navratra2015 &nbsp;</span></p>', '<ul style=\"box-sizing: border-box; outline: 0px; margin: 0px 0px 0px 1.1rem; padding: 0px; font-size: 16px; line-height: 1.6; list-style-position: outside; font-family: \'Open Sans\', sans-serif; color: #75787b;\">\r\n<li style=\"box-sizing: border-box; outline: 0px; margin: 0px; padding: 0px; font-size: 14px; color: #585858; line-height: 1.8;\">Credit cards accepted</li>\r\n</ul>', '<p><span style=\"color: #585858; font-family: \'Open Sans\', sans-serif; font-size: 14px; line-height: 20px;\">Non-Cancellable</span></p>', 'Entry Tickets to EsselWorld & Water Kingdom', '<ul>\r\n<li class=\"showmore-items\" style=\"box-sizing: border-box; outline: 0px; margin: 0px; padding: 0px; font-size: 14px; color: #585858; line-height: 1.8; font-family: \'Open Sans\', sans-serif;\">It is recommended that you make a prior reservation</li>\r\n<li class=\"showmore-items\" style=\"box-sizing: border-box; outline: 0px; margin: 0px; padding: 0px; font-size: 14px; color: #585858; line-height: 1.8; font-family: \'Open Sans\', sans-serif;\">Upon arrival, present the voucher on your phone</li>\r\n<li class=\"showmore-items\" style=\"box-sizing: border-box; outline: 0px; margin: 0px; padding: 0px; font-size: 14px; color: #585858; line-height: 1.8; font-family: \'Open Sans\', sans-serif;\">\r\n<p style=\"box-sizing: border-box; outline: 0px; margin: 0px 0px 1.25rem; padding: 0px; font-family: inherit; line-height: 20px; text-rendering: optimizeLegibility;\">Redeem the voucher before consumption</p>\r\n</li>\r\n</ul>', '')
