	(1, 'Transaction Status : Deals', 'TRANSACTION STATUS : AD PLAN UPDATE ', 'RightNext', 'admin@justdial.com ', '<h3>You Ad Plan is Updated<br></h3>Hello ##USER_FNAME##,<br>&nbsp;<br>Thanks you for purchasing &nbsp;offers &nbsp;on ##APP_LINK##&nbsp; for the deal &nbsp;\"##DEAL_TITLE##\"<br><div><br>Transaction ID: ##TRANS_ID##<br>Transaction Status: ##TRANS_STATUS##<br><br>Following is the order status:<br>##TABLE_PLAN_SUMMARY##<br><br>Thanks and Regards,<br><br>\r\n                <br></div><br><br><br><br><br>\r\n                 <br><br><br><br>', '##USER_FNAME## - Users First Name~                         ##DEAL_TITLE## - Deal Title~                         ##AD_LINK## - Ad Link~                          ##APP_LINK## - Application Link ~                         ##TABLE_PLAN_SUMMARY## - Table For Plan Summary~                          ##TRANS_ID## - Transaction ID~                         ##TRANS_STATUS## - Transaction Status', '', 1, '', '2015-12-13 22:19:30', '2016-05-09 16:55:40')
	,(2, 'Ad Posted Successfully!', 'Ad Posted Successfully!', 'RightNext', 'admin@justdial.com ', '<h3>Ad Posted Successfully!</h3>Hello ##USER_FNAME##,<br>&nbsp;<br>Thanks you for posting your Ad on ##APP_LINK## . Ad Title: \"##AD_TITLE##\"<br>View Ad : ##AD_LINK##\n\n              <div><br>Thanks and Regards,<br><br>\n                <br></div><br><br><br><br><br>', '##USER_FNAME## - Users First Name~\n##AD_TITLE## - Ad Title~\n##AD_LINK## - Ad Link~ \n##APP_LINK## - Application Link ', '', 1, '', '2015-12-13 22:56:10', '2016-01-21 02:00:38')
	,(3, 'Registration Successful Via Social', 'REGISTRATION SUCCESSFULL AT CLASSIFIED', 'RightNext', 'admin@justdial.com ', '<h2>Account Registered Successfully at&nbsp; ##APP_LINK## </h2>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <br><b>Hello ##USER_FNAME## </b>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Your Credentials are as follows: <br><div>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <span>Email: <b>##USER_EMAIL##</b></span><br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <span>Password: <b>##USER_PLAIN_PASS##</b></span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <br><br>Thanks and Regards,<br></div><br><br>', '##USER_FNAME## - Users First Name~ \n##USER_EMAIL## - Users Email~ \n                            ##USER_PLAIN_PASS## - Users Plain Text Password~ \n                            ##APP_LINK## - Application Link ', '', 1, '', '2015-12-15 21:35:47', '2016-01-21 00:28:21')
	,(4, 'Account Activation', 'VERIFY YOUR EMAIL ADDRESS', 'RightNext', 'admin@justdial.com ', '<h2>Verify Your Email Address</h2><br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <br><b></b><br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <b> Hello ##USER_FNAME## </b><br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <div><br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Thanks for creating an account with the verification ##APP_NAME## .<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Please follow the link below to verify your email address<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; ##RESET_LINK## .<br><br><br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </div>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <br><div>&nbsp;Thanks and Regards,<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </div><br><br><br><br>', '##USER_FNAME## - Users First Name~ \n                      ##APP_NAME##   - Application Name~ \n                      ##RESET_LINK##  - Password Reset Link', 'test.blade.php', 1, '', '2015-12-15 21:36:49', '2016-07-05 18:08:33')
	,(5, 'Bid was made your ad ', 'BID WAS MADE YOUR AD ', 'RightNext', 'admin@justdial.com ', 'Hello ##AD_USER_FNAME## ,<br><br>&nbsp;Bid was made on your Ad \"##AD_LINK##\"<br><br>Following are the details:<br><br>&nbsp;Bidder Email: ##BIDDER_EMAIL##<br>&nbsp;Bidder Price: ##BIDDER_PRICE##<br>&nbsp;Bidder Message: ##BIDDER_MSG##<br><br>&nbsp;Thanks and Regards,                 <br><br><br><br><br>', '##AD_USER_FNAME## - Users First Name~\n                ##BIDDER_EMAIL## - Users Email~\n                ##BIDDER_PRICE## - Price~\n                ##BIDDER_MSG## - Msg~\n                ##AD_LINK## - Ad Link~ \n                ##APP_LINK## - Application Link ', 'test.blade.php', 1, '', '2015-12-15 21:36:49', '2016-01-21 06:47:01')
	,(6, 'Ad Plan Expired', 'AD PLAN EXPIRED', 'RightNext', 'admin@justdial.com ', '<h2>Ad Plan Expired </h2>\n                     <br>      \n                     <b> Hello ##USER_FNAME##,<br><br></b>\n                     <div>\n                        For the Ad \'##AD_LINK##\'&nbsp; Posted at ##APP_LINK##\n\n               \n                        ,<br><br>Following is the list of expired plans \n                        \n                                <br><br>##TABLE_EXPIRED_PLANS##<br><br>Please Update the Plans to Continue the Featured Listing<br><br></div>\n                       \n                     <div> \n                        Thanks and Regards,\n                     </div>\n                      \n                 <br><br>', '##USER_FNAME## - Users First Name~\n                ##AD_LINK## - Ad Link~ \n                ##APP_LINK## - Application Link ~\n                ##TABLE_EXPIRED_PLANS## - Table Expired Plans', 'test.blade.php', 1, '', '2015-12-15 21:36:49', '2016-01-21 07:05:10')
	,(7, 'Ad Alert Created ', 'AD ALERT CREATED AT CLASSIFIED', 'RightNext', 'admin@justdial.com ', '<h2>Ad Alert Created  </h2>\n                     <br>      \n                     <b> Hello ##USER_EMAIL##,<br><br></b>\n                Ad Alert for ##CATEGORY## >> ##SUB_CATEGORY## , you will receive email notification for it whenever relevant ads will be posted   \n                       \n                     <div> \n                        Thanks and Regards,\n                     </div>\n                      \n                 <br><br>', '##USER_EMAIL## - Users Email~\n##APP_NAME## - Application Name ~\n##CATEGORY## - Category Name ~ ##SUB_CATEGORY## - Sub Category Name', 'test.blade.php', 1, '', '2015-12-15 21:36:49', '2016-01-21 07:05:10')
	,(8, 'Ad Expiry Remainder', 'AD PLAN GOING TO EXPIRE IN 3 DAYS', 'RightNext', 'admin@justdial.com ', '<h2>Ad Plan Going to Expire in 3 days </h2>\r\n                     <br>      \r\n                     <b> Hello ##USER_FNAME##,<br><br></b>\r\n                     <div>\r\n                        For the Ad \'##AD_LINK##\'&nbsp; Posted at ##APP_LINK##\r\n\r\n               \r\n                        ,<br><br>Following is the list of expired plans \r\n                        \r\n                                <br><br>##TABLE_ABOUT_TO_EXPIRE_PLANS##<br><br>Please Update the Plans to Continue the Featured Listing<br><br></div>\r\n                       \r\n                     <div> \r\n                        Thanks and Regards,\r\n                     </div>\r\n                      \r\n                 <br><br>', '##USER_FNAME## - Users First Name~\n                ##AD_LINK## - Ad Link~ \n                ##APP_LINK## - Application Link ~\n                ##TABLE_ABOUT_TO_EXPIRE_PLANS## - Table Expired Plans', 'test.blade.php', 1, '', '2015-12-15 21:36:49', '2016-03-28 16:29:41')
	,(9, 'Contact Us', 'CONTACT ENQUIERY', 'RightNext', 'admin@justdial.com', 'Thanks For Contact Us,<br><br>User Name :&nbsp;##USER FULL NAME##&nbsp;<br>Contact Number :&nbsp;##USER CONTACT NUMBER##&nbsp;<br>Email Id :&nbsp;##USER EMAILID##<br><br><br><br>', '##USER FULL NAME##~##USER CONTACT NUMBER##~##USER EMAILID##', '', 1, '', '2016-02-25 21:01:33', '2016-04-03 21:24:33')
	,(10, 'Enquiry Email', 'ENQUIRY EMAIL', 'RightNext', 'admin@justdial.com', 'New business inquiry with following details&nbsp;,<br><br>User Name :&nbsp;##USER FULL NAME##&nbsp;<br>Contact Number :&nbsp;##USER CONTACT NUMBER##&nbsp;<br>Email Id :&nbsp;##USER EMAILID##<br>Subject :&nbsp;##SUBJECT##<span>&nbsp;<br></span>Message :&nbsp;##MESSAGE##<br><br><br>', '##USER FULL NAME##~##USER CONTACT NUMBER##~##USER EMAILID##~##SUBJECT##~##MESSAGE##', '', 1, '', '2016-04-04 03:01:04', '2016-04-03 22:18:17')
	,(11, 'Password Recover', 'RECOVER YOUR PASSWORD', 'RightNext', 'admin@justdial.com ', '<h2><b>&nbsp;Hello ##USER_FNAME##</b>&nbsp; &nbsp;<br></h2><h2>Reset your password&nbsp;&nbsp;with the verification on&nbsp;&nbsp;##APP_NAME## .</h2><div>&nbsp;Please follow the link below to recover your password<br>&nbsp;##RESET_LINK## .<br><br><br>&nbsp; Thanks and Regards,<br></div><div>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </div><br><br><br><br>', '##USER_FNAME## - Users First Name~ \r\n                      ##APP_NAME##   - Application Name~ \r\n                      ##RESET_LINK##  - Password Reset Link', 'test.blade.php', 1, '', '2015-12-15 21:36:49', '2016-04-09 21:20:27')
	,(12, 'Account Creation', 'ACCOUNT CREATION MAIL', 'RightNext', 'admin@justdial.com ', '<br>Hello #USER_FNAME###<br><br>Your account has been created successfuly on&nbsp; ##APP_NAME##<br><br>Your account details shown below:<br><br><div>User Name &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp; :&nbsp;##USER_FNAME##&nbsp;<br>User Email&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;  &nbsp; &nbsp;&nbsp; :&nbsp;##USER_EMAIL##&nbsp;<br>User Password &nbsp; &nbsp;&nbsp; :&nbsp;##USER_PASSWORD##&nbsp;<br>User Public ID&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; :&nbsp;##USER_PUBLIC_ID##&nbsp;&nbsp; <br><br><br>Thanks &amp; Regards,&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp; <br></div><br><br><br><br>', '##USER_FNAME## - Users First Name~                       ##APP_NAME##   - Application Name~                       ##USER_EMAIL##  - User Email~##USER_PASSWORD##  - User Password', 'test.blade.php', 1, '', '2015-12-15 21:36:49', '2016-07-08 00:09:42')
	,(13, 'Transaction Success', 'TRANSACTION SUCCESS MAIL', 'RightNext', 'admin@justdial.com ', '<h4>Hello ##USER_FNAME##,<br></h4><div>&nbsp;Thanks you for choosing the best &nbsp;##PLAN## plan&nbsp;on ##APP_LINK##&nbsp; for your Business&nbsp;##BUSINESS_NAME##&nbsp;</div><div><br><div>Following is the Business Membership Transaction Details:&nbsp;<br><br>Membership Plan&nbsp; :&nbsp;&nbsp;##PLAN##<br><div>Business Name &nbsp; &nbsp; &nbsp;: &nbsp;##BUSINESS_NAME##</div><div>Business Category : &nbsp;##CATEGORY##</div><div>Transaction ID &nbsp; &nbsp; &nbsp; : &nbsp;##TRANS_ID##</div><div>Payment Mode &nbsp; &nbsp; &nbsp; : &nbsp;##MODE##</div><div>Transaction Status &nbsp;: &nbsp;##TRANS_STATUS##</div><div>Expiry Date &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;: &nbsp;##EXPIRY##</div><br><br>Thanks and Regards,<br></div>&nbsp; &nbsp;</div>', '##BUSINESS_NAME## - Business Name ~##CATEGORY## - Business Category ~##TRANS_ID## - Transaction ID ~   ##MODE## - Payment Mode ~##TRANS_STATUS## - Transaction Status ~##EXPIRY## - Expiry Date ~##PLAN## - Membership Plan', 'test.blade.php', 1, '', '2015-12-15 21:36:49', '2016-04-12 22:33:52');

