	,(9, 'test231', '<p>test231</p>\r\n', 1, '2016-04-11 00:30:31', '2016-04-10 18:58:18', '0000-00-00 00:00:00', 7, '')
	,(10, 'At vero eos et accusamus et iusto odio dignissimos?', 'Secoin encaustic cement tiles are hand-made, aesthetic tiles with many colored patterns used for floor and wall coverings.  Our tiles are made with two layers: The first layer (about 2-3mm thick) is a mixture of white cement, pigment, stone powder and additives which is hand-poured into divider mould to create desired patterned. The second layer is made of grey cement and sand to ensure the strength of tiles.', 1, '2016-04-11 00:30:31', '2016-04-10 18:58:18', '0000-00-00 00:00:00', 0, 'at-vero-eos-et-accusamus-et-iusto-odio-dignissimos')
	,(11, ' How a Claimed Listings Looks ', 'Secoin encaustic cement tiles are hand-made, aesthetic tiles with many colored patterns used for floor and wall coverings.  Our tiles are made with two layers: The first layer (about 2-3mm thick) is a mixture of white cement, pigment, stone powder and additives which is hand-poured into divider mould to create desired patterned. The second layer is made of grey cement and sand to ensure the strength of tiles.', 1, '2016-04-11 00:30:31', '2016-04-10 18:58:18', '0000-00-00 00:00:00', 0, 'how-a-claimed-listings-looks')
	,(12, 'How to Add Listings ?', 'Upon confirmation, your listing will appear throughout the website and will be searchable by visitors interested on similar places. A badge will be added to your listing to mark it as official.', 1, '2016-04-11 00:30:15', '2016-04-10 18:58:02', '0000-00-00 00:00:00', 0, 'add-listings')
	,(13, 'What is your favorite food?', '<p>Icecream</p>\r\n', 0, '2016-11-21 23:49:07', '2016-11-21 23:49:07', '0000-00-00 00:00:00', 0, 1)
	,(14, 'what is your name?', '<p>&nbsp;snehal avhad</p>\r\n', 0, '2016-11-21 23:49:55', '2016-11-21 23:49:55', '0000-00-00 00:00:00', 0, 12)
